import React from 'react';

const Payroll: React.FC = () => {
  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Payroll</h1>
        <p className="text-gray-600">Process salaries and manage statutory compliance.</p>
      </div>

      <div className="card p-8 text-center">
        <h3 className="text-lg font-medium text-gray-900 mb-2">Payroll Management</h3>
        <p className="text-gray-600">This module will include salary processing, TDS calculation, PF/ESI management, and statutory compliance.</p>
      </div>
    </div>
  );
};

export default Payroll;
